import Navbar from './components/Navbar';
import './App.css';
import { Routes,Route, BrowserRouter, } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';
import Category from './components/Category';
import Sidenav from './components/Sidenav';
import Dashboard from './components/Dashboard';
import Ctc from './components/Ctc';
import  Gender from './components/Gender'
function App() {
  return (
    <>
    <h1>
      VBooks
      <ul>
        <nav>
         <li id="list"> <NavLink to='/home'>Home</NavLink></li>
         <li id="list"><NavLink to='/about'>About</NavLink></li>
         <li id="list"><NavLink to='/signin'>SignIn</NavLink></li>
        </nav>
        </ul>
    </h1> <div className="App">


    <BrowserRouter>

      <Sidenav/>
      <Routes>
        <Route path='/home' element={<Home/>}/>
        <Route path='/dashboard' element={<Dashboard/>}/>
        <Route path='/gender' element={<Gender/>}/>
        <Route path='/hc' element={<Category/>}/>
        <Route path='/ctc' element={<Ctc/>}/>
        <Route path='/ctc' element={<Ctc/>}/>
        <Route path='/ctc' element={<Ctc/>}/>
        <Route path='/ctc' element={<Ctc/>}/>
        <Route  id="root" path='/about' element={<About/>}/>
      <Route  id="root" path='/category' element={<Category/>}/>
      </Routes>

    </BrowserRouter>
   </div>
    </>
  );
}

export default App;
